import styled from "styled-components";

export const Items = styled.ul`
  width: 104px;
  height: 834px;
  background: #1e1d2a;
  padding: 24px 0 0 12px;
`;

export const Logo = styled.div`
  width: 56px;
  heihgt: 56px;
  background: #553c3a;
  border-radius: 12px;
  cursor: pointer;
  text-align: center;
  padding: 8px;
  cursor: pointer;
`;

export const Item = styled.li`
  width: 92px;
  height: 80px;
  margin: 12px 0 0;
  background: #252836;
  border-radius: 12px 0px 0px 12px;
  padding: 12px 0;
  text-align: center;
  display: flex;
  justify-content: center;
  align-items: center;
  position: relative;
`;

export const Border = styled.div`
  position: absolute;
  top: -20px;
  height: 20px;
  width: 100%;
  background: #fff;
`;

export const Border1 = styled.div``;

export const Wrapper = styled.div`
  width: 56px;
  height: 56px;
  transition: all 0.4s ease;
  display: flex;
  justify-content: center;
  align-items: center;
  border-radius: 10px;

  &:hover {
    background: #553c3a;
  }
`;
